/* eslint-disable react-hooks/exhaustive-deps */
/* eslint-disable @typescript-eslint/no-unused-vars */
/* eslint-disable jsx-a11y/alt-text */

import Navbar from "../components/views/Navbar";
import Sidebar from "../components/views/Sidebar";
import Set from "react-icons";
import { WalletMultiButton } from "@solana/wallet-adapter-react-ui/lib/WalletMultiButton";
import Bears from '../components/assets/bears.svg'
import Logo from "../components/assets/logo.png";
import { useWallet } from "@solana/wallet-adapter-react";
import { useEffect } from "react";
import { redirect } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { BACKEND_URL } from "../constant/env";
import axios from "axios";


// import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";
const Index = () => {
    const { publicKey, wallet } = useWallet();
    let navigate = useNavigate();

    useEffect(() => {
        try {
            // axios.get(`${BACKEND_URL}/admin/getTweet`).then((res) => {
            // 	if (res.status == 200) {
            // 		console.log('tweet', res.data.tweet);
            // 		setTweetLink(res.data.tweet.tweetLink);
            // 		setTweetId(res.data.tweet.tweetId);
            // 		setUserName(res.data.tweet.userName);
            // 		setTweetOptions(res.data.tweet.option);
            // 	}
            // }).catch((err) => {
            // 	console.log('error', err)
            // })
            if (wallet && publicKey) {
                console.log("index");
                axios.post(`${BACKEND_URL}/user`, {
                    walletAddress: publicKey.toString(),
                }).then((data)=>{
                    console.log('res',data);
                    localStorage.setItem("role",data.data.role);
                    navigate("/home");
                });
            }
        } catch (error) {
            console.error(error);
        }
    }, [wallet, publicKey]);

    return (
        <div className="lg:flex h-screen relative">
            {/* Left  */}
            <div className="basis-half h-full bg-black flex justify-center items-center">
                <div >
                    <h1 className="text-5xl text-white" style={{ fontFamily: 'impact' }}>
                        FRESHEST ON WEB3
                    </h1>
                    <h1 className="text-white mt-5">
                        Get access to a never seen experience & build your GANG
                    </h1>
                    <WalletMultiButton className="mt-5" />
                </div>
            </div>
            {/* Right  */}
            <div className="basis-half h-full bg-white" style={{ backgroundImage: `url(${Bears})`, backgroundSize: 'cover', backgroundRepeat: 'no-repeat' }}>
            </div>
            <div className="absolute flex bg-white border-2 top-10 left-40 right-40 border-purple-800 justify-between">
                <img src={Logo} className="ml-5 my-4" style={{height:"60px"}}></img>
                <div className="my-auto mr-10">
                    <WalletMultiButton />
                </div>
            </div>
        </div>
    );
};

export default Index;
